export class LoginComponent {

}

<form>
  <div>
    <h3>Login</h3>
  </div>
  <div>
    <label for="Username">Username</label>
    <input type="text" name="Username" placeholder="Insert Username" class=" form-control"  style="width: 50%;"/>
